/* global Blob, atob */
import { test } from 'qunit';
import moduleForAcceptance from 'video-upload-frontend/tests/helpers/module-for-acceptance';

moduleForAcceptance('Acceptance | index');

test('it rejects a file type that is not an mp4', function(assert) {
  visit('/');
  const file = new Blob(['test'], {type: 'plain/txt'});
  file.name = 'test.txt';
  triggerEvent('.km-ember-file-upload', 'change', { target: { files: [file] } } );

  andThen(function() {
    assert.equal(find('div.errors').text(), 'That is not a valid video file. Please select an mp4 file.');
  });
});

test('it successfully sends a request when a bad mp4 video is selected, but then displays an error', function(assert) {
  visit('/');
  const file = new Blob(['ftypisomisomiso2mp4toodataLavf53.21.1'], {type: 'video/mp4'});
  file.name = 'test.mp4';
  triggerEvent('.km-ember-file-upload', 'change', { target: { files: [file] } } );

  andThen(function() {
    assert.equal(find('div.errors').text(), 'That does not seem to be a valid mp4 file. Pick another video.', 'it displays an error');
  });
});

const fileEncoded = "";

test('it successfully sends a video and displays the video', function(assert) {
  visit('/');
  const file = new Blob([atob(fileEncoded)], {type: 'video/mp4'});
  triggerEvent('.km-ember-file-upload', 'change', { target: { files: [file] } } );

  andThen(function() {
    assert.ok(find('video').hasClass('video-player'), 'it loads the video-player');
  });
});
